import logo from "../assets/exam.png"
const dname = "localhost:3000"
export default ({loggedIn, accountName, userID}) => (
    <div className="main">
        <div className="logo" >
            <a href={dname} >
                <img src={logo} alt="logo" />
            </a>
        </div>
            <div className="logo" />
            {
                loggedIn ? <a className="account" href={`${dname}/user/${userID}`}>{accountName}</a> : <div className="account">
                    <a href={`${dname}/login`}>Login</a><a href={`${dname}/signup`}>Sign up</a>
                </div>
            }

    <style jsx>{`
        .main {
            position: relative;
            display: flex;
            flex-direction: column;
            justify-content: center;
            height: 3rem;
            background: #2C404D;
        }

        .account {
            align-self: flex-end;
            display: flex;
            width: 20%;
            justify-content: space-around;
        }

        .logo {
            position: absolute;
            top: .5rem;
            left: .5rem;
            width: 32px;
            height: 32px
        }

    `}</style>
    </div>
)
